--
-- Aquest script:
--
--        1) Crea les taules de la base de dades AEROLINIES,
--        2) crea les constraints, i
--        3) hi afegeix els registres. 
--
-- Si ja s'ha executat previament, l'script
-- esborra les taules de la base de dades i les torna a editar. 
-- De tal manera, cal IGNORAR els missatges d'error que dóna 
-- la primera vegada que s'executa. 
--
--------------------------------------------------------
DROP TABLE "AEROPORT" cascade constraints;
DROP TABLE "AUXILIAR" cascade constraints;
DROP TABLE "AVIO" cascade constraints;
DROP TABLE "BITLLET" cascade constraints;
DROP TABLE "BUTAQUES" cascade constraints;
DROP TABLE "COMPRADOR" cascade constraints;
DROP TABLE "MALETA" cascade constraints;
DROP TABLE "PASSATGER" cascade constraints;
DROP TABLE "PERSONAL" cascade constraints;
DROP TABLE "PERSONAL_AVIO" cascade constraints;
DROP TABLE "PILOT" cascade constraints;
DROP TABLE "PORTA_EMBARCAMENT" cascade constraints;
DROP TABLE "RESERVA" cascade constraints;
DROP TABLE "RUTA" cascade constraints;
DROP TABLE "VIATGES" cascade constraints;
DROP TABLE "VOL" cascade constraints;
--------------------------------------------------------
--  DDL for Table AEROPORT
--------------------------------------------------------

  CREATE TABLE "AEROPORT" 
   (	"CODI_AEROPORT" VARCHAR2(3 CHAR), 
	"NOM" VARCHAR2(60 CHAR), 
	"CIUTAT" VARCHAR2(40 CHAR), 
	"PAIS" VARCHAR2(30 CHAR)
   ) ;
--------------------------------------------------------
--  DDL for Table AUXILIAR
--------------------------------------------------------

  CREATE TABLE "AUXILIAR" 
   (	"SS" VARCHAR2(14 CHAR), 
	"IDIOMES" CLOB
   ) ;
--------------------------------------------------------
--  DDL for Table AVIO
--------------------------------------------------------

  CREATE TABLE "AVIO" 
   (	"MATRICULA" VARCHAR2(10 CHAR), 
	"MARCA" VARCHAR2(20 CHAR), 
	"MODEL" VARCHAR2(25 CHAR), 
	"ANY_FABRICACIO" NUMBER(4,0), 
	"REPARACIONS" CLOB
   ) ;
--------------------------------------------------------
--  DDL for Table BITLLET
--------------------------------------------------------

  CREATE TABLE "BITLLET" 
   (	"DATA" DATE, 
	"PASSATGER" VARCHAR2(11 CHAR), 
	"CODI_VOL" VARCHAR2(7 CHAR), 
	"CATEGORIA" VARCHAR2(20 CHAR), 
	"MATRICULA_AVIO" VARCHAR2(10 BYTE), 
	"CODI_AEROPORT" VARCHAR2(3 CHAR), 
	"FILA_SEIENT" NUMBER, 
	"LLETRA_SEIENT" VARCHAR2(1 BYTE), 
	"TERMINAL" NUMBER, 
	"AREA" NUMBER, 
	"PORTA_EMBARCAMENT" NUMBER, 
	"NUMERO_RESERVA" VARCHAR2(10 CHAR)
   ) ;
--------------------------------------------------------
--  DDL for Table BUTAQUES
--------------------------------------------------------

  CREATE TABLE "BUTAQUES" 
   (	"MATRICULA_AVIO" VARCHAR2(10 CHAR), 
	"FILA" NUMBER(2,0), 
	"LLETRA" VARCHAR2(1 CHAR)
   ) ;
--------------------------------------------------------
--  DDL for Table COMPRADOR
--------------------------------------------------------

  CREATE TABLE "COMPRADOR" 
   (	"NIF" VARCHAR2(11 CHAR), 
	"NOM" VARCHAR2(50 CHAR), 
	"NUMERO_TARGETA" NUMBER(16,0), 
	"CADUCITAT_TARGETA" DATE, 
	"ADREÇA" VARCHAR2(40 CHAR), 
	"CP" NUMBER(5,0), 
	"POBLACIO" VARCHAR2(40 CHAR), 
	"PAIS" VARCHAR2(25 CHAR), 
	"TELEFON" NUMBER(9,0), 
	"EMAIL" VARCHAR2(40 CHAR)
   ) ;
--------------------------------------------------------
--  DDL for Table MALETA
--------------------------------------------------------

  CREATE TABLE "MALETA" 
   (	"DATA" DATE, 
	"PASSATGER" VARCHAR2(9 CHAR), 
	"CODI_VOL" VARCHAR2(7 CHAR), 
	"ID" NUMBER, 
	"PES" NUMBER
   ) ;
--------------------------------------------------------
--  DDL for Table PASSATGER
--------------------------------------------------------

  CREATE TABLE "PASSATGER" 
   (	"NIF" VARCHAR2(11 CHAR), 
	"NOM" VARCHAR2(50 CHAR), 
	"DATA_NAIXEMENT" DATE, 
	"ADREÇA" VARCHAR2(40 CHAR), 
	"CP" NUMBER(5,0), 
	"POBLACIO" VARCHAR2(40 CHAR), 
	"PAIS" VARCHAR2(25 CHAR), 
	"TELEFON" NUMBER(9,0), 
	"EMAIL" VARCHAR2(40 CHAR), 
	"OBSERVACIONS" VARCHAR2(40 CHAR)
   ) ;
--------------------------------------------------------
--  DDL for Table PERSONAL
--------------------------------------------------------

  CREATE TABLE "PERSONAL" 
   (	"SS" VARCHAR2(14 CHAR), 
	"NIF" VARCHAR2(11 CHAR), 
	"NOM" VARCHAR2(50 CHAR), 
	"NUMERO_COMPTE" VARCHAR2(22 CHAR), 
	"ADREÇA" VARCHAR2(40 CHAR), 
	"CP" NUMBER(5,0), 
	"POBLACIO" VARCHAR2(40 CHAR), 
	"PAIS" VARCHAR2(25 CHAR), 
	"TELEFON" NUMBER(9,0), 
	"EMAIL" VARCHAR2(40 CHAR)
   ) ;
--------------------------------------------------------
--  DDL for Table PERSONAL_AVIO
--------------------------------------------------------

  CREATE TABLE "PERSONAL_AVIO" 
   (	"MATRICULA" VARCHAR2(10 CHAR), 
	"SS" VARCHAR2(14 CHAR)
   ) ;
--------------------------------------------------------
--  DDL for Table PILOT
--------------------------------------------------------

  CREATE TABLE "PILOT" 
   (	"SS" VARCHAR2(14 CHAR), 
	"HORES_VOL" NUMBER, 
	"NUMERO_CARNET" VARCHAR2(25 CHAR)
   ) ;
--------------------------------------------------------
--  DDL for Table PORTA_EMBARCAMENT
--------------------------------------------------------

  CREATE TABLE "PORTA_EMBARCAMENT" 
   (	"CODI_AEROPORT" VARCHAR2(3 CHAR), 
	"TERMINAL" NUMBER(3,0), 
	"AREA" NUMBER(3,0), 
	"PORTA" NUMBER(3,0)
   ) ;
--------------------------------------------------------
--  DDL for Table RESERVA
--------------------------------------------------------

  CREATE TABLE "RESERVA" 
   (	"LOCALITZADOR" VARCHAR2(10 CHAR), 
	"COMPRADOR" VARCHAR2(11 CHAR), 
	"PREU" NUMBER, 
	"IVA" NUMBER
   ) ;
--------------------------------------------------------
--  DDL for Table RUTA
--------------------------------------------------------

  CREATE TABLE "RUTA" 
   (	"CODI_ORIGEN" VARCHAR2(7 CHAR), 
	"CODI_DESTI" VARCHAR2(7 CHAR)
   ) ;
--------------------------------------------------------
--  DDL for Table VIATGES
--------------------------------------------------------

  CREATE TABLE "VIATGES" 
   (	"CODI_VOL" VARCHAR2(10 BYTE), 
	"NIF_PASSATGER" VARCHAR2(11 CHAR)
   ) ;
--------------------------------------------------------
--  DDL for Table VOL
--------------------------------------------------------

  CREATE TABLE "VOL" 
   (	"CODI" VARCHAR2(7 CHAR), 
	"DIA" VARCHAR2(10 CHAR), 
	"HORA_SORTIDA" DATE, 
	"HORA_ARRIBADA" DATE, 
	"COMPANYIA" VARCHAR2(60 CHAR), 
	"AVIO" VARCHAR2(10 CHAR), 
	"ORIGEN" VARCHAR2(3 CHAR), 
	"DESTI" VARCHAR2(3 CHAR)
   ) ;
